import React from "react";
import { Header, Footer } from "../components/index";

const HeatMap = () => {
  return (
    <div>
      <Header />

      <div className="row">
        <div className="col-12">
          <div className="tabs p-3">
            <div className="row">
              <div className="col-6">
                <div className="heatmap"></div>
              </div>
              <div className="col-6"></div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default HeatMap;
